import react from "react";
import "./TopBar.css";
import logo from "./logo.png";
// import dp from "./glow.jpg";


export default class TopBar extends react.Component {

    componentDidMount() {
        const Ulkitscript1 = document.createElement("script");
        Ulkitscript1.src = "https://cdn.jsdelivr.net/npm/uikit@3.10.1/dist/js/uikit.min.js";
        Ulkitscript1.async = true;

        const Ulkitscript2 = document.createElement("script");
        Ulkitscript2.src = "https://cdn.jsdelivr.net/npm/uikit@3.10.1/dist/js/uikit-icons.min.js";
        Ulkitscript2.async = true;

        document.body.appendChild(Ulkitscript1);
        document.body.appendChild(Ulkitscript2);

    }

    render(props) {

        return (
            <section id="top-section">

                <nav className="uk-navbar-container uk-navbar-transparent" uk-navbar='true'>

                    <div className="uk-navbar-left">

                        <ul className="uk-navbar-nav">
                            <li className="uk-active uk-logo"><a href="."> <img src={logo} alt='' /> </a></li>
                        </ul>

                    </div>

                    <div className="uk-navbar-right">

                        <ul className="uk-navbar-nav">
                            <li className="uk-active"><a className=" uk-button-text" href="/"> Works   </a></li>
                            <li className="uk-active uk-button-text"><a href="/"> Contact </a></li>
                        </ul>

                    </div>

                </nav>


                <div class="uk-child-width-expand@s uk-text-center second-bar" uk-grid='true'>

                <div className="info-img">
                        <img src="" alt="" />
                    </div>

                    <div className="info">
                        <div className="uk-card info-section uk-card-body">
                            <h1 id="name"> Purushothaman G </h1>
                            <p> Website designer for more than 2 years </p>
                        </div>
                    </div>


                </div>

            </section>
        )
    }

}
